// Dice.js
import React from 'react';
import './Dice.css';

const Dice = ({ value }) => {
const diceImages = [
'./dice-1.png',
'./dice-2.png',
'./dice-3.png',
'./dice-4.png',
'./dice-5.png',
'./dice-6.png',
];
return (
<div className="dice">
<img src={diceImages[value - 1]} alt={`Dice ${value}`} />
</div>
);
};

export default Dice;
